return items.map(item => {
  const results = item.json["organic_results"] || [];

  let linkedin = null;
  let snippet = null;
  let rawTitle = null;
  let rich = [];
  let designation = null;
  let company = null;
  let location = null;

  for (const r of results) {
    if (r.link && r.link.includes("linkedin.com/in/")) {
      linkedin = r.link;
      snippet = r.snippet || null;
      rawTitle = r.title || null;
      rich = r.rich_snippet?.top?.extensions || [];

      if (rich.length >= 3) {
        location = rich[0];
        designation = rich[1];
        company = rich[2];
      }

      break;
    }
  }

  let name = item.json.name;
  let email = item.json.email;

  if ((!name || !email) && item.json.searchQuery) {
    const query = item.json.searchQuery;
    const nameMatch = query.match(/in\s+"([^"]+)"\s+OR/);
    if (!name && nameMatch) name = nameMatch[1];

    const emailMatch = query.match(/OR\s+"([^"]+@[^"]+)"/);
    if (!email && emailMatch) email = emailMatch[1];
  }

  // Extract title from rawTitle by removing name before "-"
  let title = "";
  if (rawTitle && rawTitle.includes(" - ")) {
    title = rawTitle.split(" - ").slice(1).join(" - ").trim();
  } else if (designation) {
    title = designation;
  }

  return {
    json: {
      name: name || null,
      searchQuery: item.json.searchQuery || null,
      extractedLinkedIn: linkedin || "Not Found",
      title,
      snippet,
      designation,
      company,
      location
    }
  };
});

return items.map(item => {
  const Email = item.json["Email"] || item.json.email || "";
  let Name = item.json["Name"] ;
  if(! Name ){
  const firstName = item.json["First name"] || "";
  const lastName = item.json["Last name"] || "";
   Name = `${firstName} ${lastName}`.trim();
  }
  return {
    json: {
      Email,
      Name,
      searchQuery: `site:linkedin.com/in "${Name}" OR "${Email}"`
    }
  };
});

const input = $input.all();
return input.map(item => {
  const data = item.json;

  // Extract name from snippet (before first dot)
  let name = "";
  if (data.snippet) {
    const firstPart = data.snippet.split(".")[0];
    name = firstPart.trim();
  }

  // Initialize title
  let title = "";

  // 1. Try designation
  if (data.designation && data.designation.length >= 5) {
    title = data.designation.trim();
  }

  // 2. Try title field (left part before ' - ') if title is still empty
  if (!title && data.title) {
    const temp = data.title.split(" - ")[0].trim();
    if (temp.length >= 5 &&
        temp.toLowerCase() !== (data.company || "").toLowerCase() &&
        !temp.toLowerCase().includes("india") &&
        !temp.toLowerCase().includes("limited")) {
      title = temp;
    }
  }

  // 3. Fallback to second sentence in snippet if still empty
  if (!title && data.snippet) {
    const parts = data.snippet.split(".");
    if (parts.length > 1) {
      const fallback = parts[1].trim();
      if (fallback.length >= 5 && fallback.length <= 80) {
        title = fallback;
      }
    }
  }

  return {
    json: {
      Name: name || "",
      LinkedIn: data.extractedLinkedIn || "Not Found",
      Title: title || "",
      Company: data.company || "",
      Location: data.location || "",
      Snippet: data.snippet || ""
    }
  };
});

const leads = $json.leads;
const icp = $json.icp;

const normalize = s => s?.toLowerCase().replace(/[^a-z0-9\s&]/g, '').trim() || '';
const splitCSV = s => s?.split(',').map(normalize).filter(Boolean) || [];
const parseRange = s => {
  const match = s?.match(/(\d+)[^\d]*(\d+)/);
  return match ? { min: +match[1], max: +match[2] } : null;
};

const headcountMatch = (icpRangeStr, leadSizeStr) => {
  if (!leadSizeStr) return false;
  const icpRange = parseRange(icpRangeStr);
  const leadRange = parseRange(leadSizeStr.replace('+', '-100000'));
  if (!icpRange || !leadRange) return false;
  return leadRange.min <= icpRange.max && leadRange.max >= icpRange.min;
};

const industryAliases = {
  'internet': ['internet', 'media', 'digital'],
  'retail': ['retail', 'ecommerce'],
  'telecommunications': ['telecom', 'telecommunications'],
  'information technology and services': ['it', 'information technology', 'software', 'saas', 'technology'],
  'real estate': ['real estate', 'property', 'housing']
};

const industryMatch = (leadIndustry, icpIndustries) => {
  const normLead = normalize(leadIndustry);
  return icpIndustries.some(i => {
    const aliases = industryAliases[i] || [i];
    return aliases.some(alias => normLead.includes(alias));
  });
};

const titleAliases = ['vp', 'vice president', 'head of sales', 'director', 'regional director', 'business development'];

const icpData = {
  locations: splitCSV(icp.demographicInfo?.location || ''),
  income: normalize(icp.demographicInfo?.incomeLevel || ''),
  designations: splitCSV(icp.professionalDetails?.commonDesignations || '').map(normalize),
  headcount: icp.professionalDetails?.companyHeadcount || '',
  industries: splitCSV(icp.industryDetails?.verticals || '')
};

const results = leads.map(lead => {
  const title = normalize(lead.Title);
  const loc = normalize(lead.Location);
  const industry = normalize(lead['Company Industry']);
  const size = lead['Company Size'];

  const locMatch = icpData.locations.some(l => loc.includes(normalize(l)));
  const titleMatch = titleAliases.some(alias => title.includes(alias));
  const industryMatched = industryMatch(industry, icpData.industries);
  const headcountMatched = headcountMatch(icpData.headcount, size);

  let score = 0;
  if (locMatch) score++;
  if (titleMatch) score++;
  if (industryMatched) score++;
  if (headcountMatched) score++;

  const totalCriteria = 4;
  const matchPercent = score / totalCriteria;
  const category = matchPercent >= 0.85 ? 'Best Fit' : matchPercent >= 0.6 ? 'Medium Fit' : 'No Fit';

  return {
    json: {
      ...lead,
      score,
      totalCriteria,
      matchPercent,
      category,
      debug: {
        locMatch,
        titleMatch,
        industryMatched,
        headcountMatched
      }
    }
  };
});

return results;
